import Slide from "../../components/slider"
import Navigator from "../../components/navigator"
import Content from "../../components/content"
import Footer from "../../components/footer"

function Galery() {
    return (
        <>
            <Slide/>
            <Navigator/>
            <Content/>
            <Footer/>
        </>
    )

}
export default Galery;
